import React from 'react';

const MusicPlayer = ({ trackUrl }) => {
    return (
        <div style={{ marginTop: '20px' }}>
            {trackUrl ? <audio controls src={trackUrl} /> : <p>Select a track to play</p>}
        </div>
    );
};

export default MusicPlayer;
